def _VOP2Op_V_MIN_F32(S0, S1, S2, D0, SCC, VCC, laneId, EXEC, literal, VGPR, src0_idx=0, vdst_idx=0, PC=None):
  if WAVE_MODE.IEEE:
    if isSignalNAN(F(S0.f32)):
      D0.f32 = F(cvtToQuietNAN(F(S0.f32)))
    elif isSignalNAN(F(S1.f32)):
      D0.f32 = F(cvtToQuietNAN(F(S1.f32)))
    elif isQuietNAN(F(S1.f32)):
      D0.f32 = S0.f32
    elif isQuietNAN(F(S0.f32)):
      D0.f32 = S1.f32
    elif LT_NEG_ZERO(S0.f32, S1.f32):
      D0.f32 = S0.f32
    else:
      D0.f32 = S1.f32
  else:
    if isNAN(F(S1.f32)):
      D0.f32 = S0.f32
    elif isNAN(F(S0.f32)):
      D0.f32 = S1.f32
    elif LT_NEG_ZERO(S0.f32, S1.f32):
      D0.f32 = S0.f32
